    false,nt"url": null,nt"notes": "This narrative report for Lake Andes NWR
    outlines Refuge accomplishments during the 1978 calendar year. The report begins
    with an introduction to the Refuge and information about weather conditions, habitat
    conditions, and the system status. Construction and maintenance are also described.
    Habitat management is covered; croplands, grasslands, wetlands, and forests are
    discussed. The wildlife section of the report discusses endangered and threatened
    species, migratory birds, mammals, and non-migratory birds. Interpretation and recreation
    activities are outlined; topics include information and interpretation, recreation,
    and law enforcement. Field investigations, cooperative programs, items of interest,
    safety information, Refuge brochures, and a review of Lake Andes water rights are
    attached.",nt"license_title": "License Not Specified",nt"extras": [{ntt"key":
